import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import Navigation from './Components/Navigation';
import Create from './Components/Create';
import ShowAllPosts from './Components/ShowAllPosts';


function App() {
  return (
    <div className="App">
      <div class="inner-box">
        <div class="inner-box">
          <div class="inner-box">
            <div class="inner-box">
              <div class="inner-box">
                <Router>
                  <Navigation/>
                  <Switch>
                    <Route path="/" exact component={Create}/>
                    <Route path="/show" component={ShowAllPosts}/>
                  </Switch>
                </Router>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
